package day11_Array_1;

public class Example02Con {

	String nam;
	
	int age;
	


	public String getNam() {
		return nam;
	}

	public void setNam(String nam) {
		this.nam = nam;
	}

	public int getAge() {
		return age;
	}

	public void setAge(int age) {
		this.age = age;
	}
	
	@Override
	public String toString() {
		// TODO Auto-generated method stub
		return nam+" "+age;
	}
	
	
	
}
